data: {"type":"response.output_text.done","sequence_number":530,"item_id":"msg_68699972f764819fb0905b81745092ed0aa0cd3bc2157ec5","output_index":1,"content_index":0,"text":"Here are some of the top news stories for Saturday, July 5, 2025:\n\n**International News:**\n\n- **NATO Summit in The Hague:** NATO members have agreed to increase annual defense spending to a new target of 5%. The summit reaffirmed the alliance's commitment to Article 5 and continued support for Ukraine. ([en.wikipedia.org](https://en.wikipedia.org/wiki/2025_The_Hague_NATO_summit?utm_source=openai))\n\n- **Pakistan-Afghanistan Border Conflict:** The Pakistani army reported killing at least 30 suspected militants attempting to cross the border from Afghanistan. ([aa.com.tr](https://www.aa.com.tr/en/world/morning-briefing-july-5-2025/3622391?utm_source=openai))\n\n- **Hamas Responds to Ceasefire Proposal:** Hamas has given a \"positive\" response to mediators regarding a ceasefire proposal in Gaza. ([aa.com.tr](https://www.aa.com.tr/en/world/morning-briefing-july-5-2025/3622391?utm_source=openai))\n\n**U.S. News:**\n\n- **Record-Breaking Independence Day Travel:** The U.S. experienced its busiest air travel weekend in 15 years, with the Department of Transportation projecting 50,000 flights on Monday and the TSA anticipating 18.5 million air travelers between July 1 and 7. ([axios.com](https://www.axios.com/newsletters/axios-pm-9a800950-58e6-11f0-9a9e-15eb739115ea?utm_source=openai))\n\n- **Nintendo Switch 2 Restocks:** Demand for the Nintendo Switch 2 remains high, with restocks selling out rapidly. Major retailers like Best Buy, Walmart, Target, and GameStop are offering limited availability. ([tomsguide.com](https://www.tomsguide.com/live/news/nintendo-switch-2-restocks-news-and-updates?utm_source=openai))\n\n**Science and Technology:**\n\n- **Third Interstellar Object Discovered:** Astronomers have identified 3I/ATLAS, the third confirmed interstellar object to pass through our Solar System. (